import React from 'react'

import styled from 'styled-components';

const MainBody = styled.div`
    max-width: 1180px;
  height: 100vh;
  display: flex;
  margin: 0 auto;
  align-items: center;

   h1 {
      font-size: 96px;
      white-space: nowrap;
    }
      .contents{
        display:flex;
        flex-direction:column;
        align-items:end;
        gap:0px;
      }

`;




const Button=styled.button`
font-size:16px;
color:white;
background-color:black;
border:none;
border-radius:5px;
width:220px;
height:44px;




`;

const StartPage = () => {
    return (
        <>
            <MainBody>
                <div>
                    <img src='./images/dices.png'/>
                </div>
                <div className='contents'>
                    <h1>DICE GAME</h1>
                    <Button>Play Now</Button>
                </div>
            </MainBody>
        </>
    )
}



export default StartPage;
